import React from "react";
import {Link} from "react-router-dom";
import Logo from "../img/logo_v3-removed.png";
import Navbar from "./HeaderNavbar";

function returnHome() {
  return (
    <Link to="/home" />
  );
}

function Header() {
  return (
    <div>
      <div id="logo-div-style">
        <img onClick={returnHome} id="logo-style"src={Logo} alt="logo"></img>
      </div>
      <div id="div-navbar">
        <Navbar />
      </div>
    </div>


  );
}

export default Header;
